-ideograph\"><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial;color:black\" lang=\"EN-US\">Launched in 20</span><span style=\"font-size:14.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Arial;color:black;\r\nmso-ansi-language:EN-IN\">22</span><span style=\"font-size:14.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Arial;color:black\" lang=\"EN-US\">, </span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial;color:black;mso-ansi-language:EN-IN\">Sqft</span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial;color:black\" lang=\"EN-US\">9.com</span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:Arial;color:black;mso-ansi-language:EN-IN\"> (Online\r\nReal Estate Solution)</span><span style=\"font-size:14.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Arial;color:black\" lang=\"EN-US\">,\r\nIndia’s </span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:Arial;color:black;mso-ansi-language:EN-IN\">start\r\nuponline </span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:Arial;color:black\" lang=\"EN-US\">property portal, deals with </span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial;color:black;mso-ansi-language:EN-IN\">allkind</span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial;color:black\" lang=\"EN-US\"> of the consumers needs in the real estate industry. It is\r\nan online </span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:Arial;color:black;mso-ansi-language:EN-IN\">Portal / </span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial;color:black\" lang=\"EN-US\">forum where buyers, sellers and brokers/agents can exchange\r\ninformation about real estate properties. </span><span style=\"font-size:14.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Arial;color:black;\r\nmso-ansi-language:EN-IN\">Here</span><span style=\"font-size:14.0pt;\r\nfont-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Arial;color:black\" lang=\"EN-US\">,\r\nyou can advertise</span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:Arial;color:black;mso-ansi-language:EN-IN\"> / Post</span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial;color:black\" lang=\"EN-US\"> a property, search for a property, browse through\r\nproperties,and keep yourself updated with the </span><span style=\"font-size:\r\n14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Arial;\r\ncolor:black;mso-ansi-language:EN-IN\">currentprice, latest </span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial;color:black\" lang=\"EN-US\">new</span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:Arial;color:black;mso-ansi-language:EN-IN\">s </span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial;color:black\" lang=\"EN-US\">making </span><span style=\"font-size:14.0pt;font-family:\r\n&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Arial;color:black;mso-ansi-language:\r\nEN-IN\">trends</span><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:Arial;color:black\" lang=\"EN-US\"> in the realty sector.</span></p>\r\n\r\n<p style=\"margin-bottom:3.75pt;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial;color:black;mso-ansi-language:EN-IN\">For any feedback or support kindly\r\nmail us on <a href=\"mailto:support@sqft9.com\">support@sqft9.com</a> or <a href=\"mailto:sqft9.india@gmail.com\">sqft9.india@gmail.com</a></span></p>\r\n\r\n<p style=\"margin-bottom:3.75pt;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:14.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\nArial;color:black;mso-ansi-language:EN-IN\">&nbsp;</span></p>\r\n\r\n<p style=\"margin-bottom:3.75pt;text-align:justify;text-justify:inter-ideograph\"><u><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Arial;\r\ncolor:black;mso-ansi-language:EN-IN\">Contact Us</span></u></p>\r\n\r\n<p style=\"margin-bottom:3.75pt;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Arial;\r\ncolor:black;mso-ansi-language:EN-IN\">Tel- +91 95912 35103</span></p>\r\n\r\n<p style=\"margin-bottom:3.75pt;text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:Arial;\r\ncolor:black;mso-ansi-language:EN-IN\">Reg. Office- No. 86, Virupakshapura (7<sup>th</sup>\r\nCross), Kodigehalli, V.R. Pura, Yelahanka, Bengaluru, Karnataka, India- 560097.</span></p>\r\n\r\n<p style=\"margin-bottom:3.75pt;text-align:justify;text-justify:inter-ideograph\"><span style=\"mso-ansi-language:EN-IN\">Mail- </span><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-f