INSERT INTO `privacypolicy` (`id`, `pdesc`, `modified_at`) VALUES
(1, '<h2 style=\"margin-top:24.5pt;margin-right:0in;margin-bottom:7.5pt;margin-left:\r\n0in;border:none;mso-border-bottom-alt:solid #A4A4A4 .75pt;padding:0in;\r\nmso-padding-alt:0in 0in 0in 0in\"><b>Our Privacy Policy</b></h2>\r\n\r\n<p style=\"margin-top:24.4pt;margin-right:3.8pt;margin-bottom:3.8pt;margin-left:\r\n3.8pt\"><span style=\"font-family: Arial, sans-serif;\">Privacy policy is subject to the terms of the </span><span lang=\"EN-IN\" style=\"font-family: Arial, sans-serif;\">Website / Portal</span><span style=\"font-family: Arial, sans-serif;\">\r\nPolicy (User agreement) of </span><span lang=\"EN-IN\" style=\"font-family: Arial, sans-serif;\">Sqft9</span><span style=\"font-family: Arial, sans-serif;\">.\r\nThis policy is effective from the date and time a user registers with </span><span lang=\"EN-IN\" style=\"font-family: Arial, sans-serif;\">Sqft9</span><span style=\"font-family: Arial, sans-serif;\"> by filling up the Registration form\r\nand accepting the terms and conditions laid out in the </span><span lang=\"EN-IN\" style=\"font-family: Arial, sans-serif;\">Webs</span><span style=\"font-family: Arial, sans-serif;\">ite Policy.</span><span style=\"font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Arial\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:24.4pt;margin-right:3.8pt;margin-bottom:3.8pt;margin-left:\r\n3.8pt\"><span style=\"font-family: Arial, sans-serif;\">To extend this personalized experience </span><span lang=\"EN-IN\" style=\"font-family: Arial, sans-serif;\">Sqft9</span><span style=\"font-family: Arial, sans-serif;\"> may track the IP address of a\r\nuser\'s computer and save certain information on your system in the form of\r\ncookies. A user has the option of accepting or declining the cookies of this\r\nwebsite by changing the settings of your browser</span><span style=\"font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Arial\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:24.4pt;margin-right:3.8pt;margin-bottom:3.8pt;margin-left:\r\n3.8pt\"><span style=\"font-family: Arial, sans-serif;\">The personal information provided by the users to </span><span lang=\"EN-IN\" style=\"font-family: Arial, sans-serif;\">Sqft9</span><span style=\"font-family: Arial, sans-serif;\"> will not be provided to third\r\nparties without previous consent of the user concerned. Information of a\r\ngeneral nature may however be revealed to external parties<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:24.4pt;margin-right:3.8pt;margin-bottom:3.8pt;margin-left:\r\n3.8pt\"><span style=\"font-family: Arial, sans-serif;\">In order to provide a personalised browsing experience, </span><span lang=\"EN-IN\" style=\"font-family: Arial, sans-serif;\">Sqft9</span><span style=\"font-family: Arial, sans-serif;\"> may collect personal information\r\nfrom you. Additionally some of our websites may require you to complete a\r\nregistration form or seek some information from you. When you let us have your\r\npreferences, we will be able to deliver or allow you to access the most\r\nrelevant information that meets your end.</span><span style=\"font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:Arial\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:24.4pt;margin-right:3.8pt;margin-bottom:3.8pt;margin-left:\r\n3.8pt\"><span style=\"font-family: Arial, sans-serif;\">Every effort will be made to keep the information provided\r\nby users in a safe manner, the information will be displayed on the website\r\nwill be done so only after obtaining consent from the users. Any user browsing\r\nthe site generally is not required to disclose his identity or provide any\r\ninformation about him/her, it is only at the time of registration you will be\r\nrequired to furnish the details in the registration form.</span><span style=\"font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Arial\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:24.4pt;margin-right:3.8pt;margin-bottom:3.8pt;margin-left:\r\n3.8pt\"><span lang=\"EN-IN\" style=\"font-family: Arial, sans-serif;\">We do</span><span style=\"font-family: Arial, sans-serif;\"> provides you the\r\nability to keep your personal information accurate and up-to-date. If at any\r\ntime you would like to a) rectify, update, correct or delete your personal\r\ninformation; b) obtain confirmation on whether or not your personal information\r\nis processed by it; c) access your personal information or exercise your right\r\nto data portability; or d) exercise your right to restrict the continuing\r\ndisclosure of your personal information to any third party by </span><span lang=\"EN-IN\" style=\"font-family: Arial, sans-serif;\">Sqft9</span><span style=\"font-family: Arial, sans-serif;\"> in certain circumstances, you are\r\nrequested to contact us at </span><span lang=\"EN-IN\" style=\"font-family: Arial, sans-serif;\"><a href=\"mailto:support@sqft9.com\">support<span lang=\"EN-US\">@</span>sqft9<span lang=\"EN-US\">.com</span></a>\r\nor sqft9.india@gmail.com</span><span style=\"font-family: Arial, sans-serif;\">. We will require you to provide a\r\nvalid </span><span lang=\"EN-IN\" style=\"font-family: Arial, sans-serif;\">govt id </span><span style=\"font-family: Arial, sans-serif;\">proof\r\nof your identity, in order to ensure that your rights are respected.</span><span style=\"font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:Arial\"><o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top:24.4pt;margin-right:3.8pt;margin-bottom:3.8pt;margin-left:\r\n3.8pt\"><span style=\"font-family: Arial, sans-serif;\">You agree that </span><span lang=\"EN-IN\" style=\"font-family: Arial, sans-serif;\">Sqft9</span><span style=\"font-family: Arial, sans-serif;\"> may use personal information about you to improve its\r\nmarketing and promotional efforts, to analyze site usage, improve the Site\'s\r\ncontent and product offerings, and customise the Site\'s content, layout, and\r\nservic