(1, '<p class=\"MsoNormal\"><b><span style=\"font-size:9.0pt;font-family:\" lang=\"EN-US\">TERMS AND CONDITIONS <br></span></b></p>\n\n<p class=\"MsoNormal\"><span style=\"font-size:9.0pt;font-family:\" lang=\"EN-US\">PLEASE READ THIS DOCUMENT CAREFULLY.\nBY ACCESSING OR USING Sqft9, YOU AGREE TO BE BOUND BY THE TERMS AND CONDITIONS\nSET FORTH BELOW. IF YOU DO NOT AGREE WITH ANY OF THESE TERMS AND CONDITIONS,\nYOU SHOULD NOT ACCESS OR USE Sqft9. IF YOU HAVE ANY QUESTIONS ABOUT THESE\nTERMS, PLEASE CONTACT <a href=\"mailto:support@sqft9.com\">support@sqft9.com</a>\nor </span><span style=\"font-size:9.0pt;font-family:\" lang=\"EN-US\">sqft9.india@gmail.com</span><b><span style=\"font-size:9.0pt;font-family:\" lang=\"EN-US\"></span></b></p>\n\n<p class=\"MsoNormal\"><b><span style=\"font-size:9.0pt;font-family:\" lang=\"EN-US\">&nbsp;</span></b></p>\n\n<p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:9.0pt;font-family:\" lang=\"EN-US\">The term Subscriber would include any person, whether an\nindividual or a legal entity who has subscribed to the Services of Sqft9\n(whether on a paid or free basis), and to whom the access to Sqft9 is\nrestricted by the use of a sign in user name and a password. The user name and\npassword are either allotted by Sqft9 or chosen by the Subscriber or agreed\nupon by Sqft9. It is made abundantly clear that only the authorized User has\nthe right to access the Services so offered by Sqft9.</span></p>\n\n<p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:9.0pt;font-family:\" lang=\"EN-US\">The term Browser/Visitor will mean and include a person who\nutilizes any of the Services offered by Sqft9, without the need or a requirement\nto create an account i.e. visits non-restricted portions of Sqft9.</span></p>\n\n<p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:9.0pt;font-family:\" lang=\"EN-US\">The use and access to Sqft9 shall be subject to these terms\nand conditions and community guidelines. For the purposes of this Agreement,\nany person who does not have a legal or a contractual right to access the\nServices, but does so, will fall within the definition of an \'unauthorized\nuser\' and will nevertheless be subject to the terms and conditions regulating\nthe usage of Sqft9, and expressly so with respect to respecting the intellectual\nproperty rights of the Sqft9, and abiding by terms and conditions below\nmentioned.</span></p>\n\n<p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:9.0pt;font-family:\" lang=\"EN-US\">The terms \'User\' and \'Customer\' would include both the\nSubscriber/Advertiser(s) and Browser/Visitor(s)</span></p>\n\n<p style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:9.0pt;font-family:\" lang=\"EN-US\">The terms \'Service\' or \'Services\' would mean to include the\ninteractive online information service offered by Sqft9 on the internet through\nwhich the user may access information carried by Sqft9 in the database\nmaintained by it. The terms would also include to mean the search tools through\nwhich the User can search through the hosted databases and information using a\nnumber of search tools that are present with a selection matching their search\ncriteria. The term would also include services by way of space used by\ncustomers for advertisements such as listings and banners. Users then select\none or more of the items presented to view the full document/ record. The term\nService does not extend to Sqft9 acting as an agent either express or implied\non behalf of any User/Customer and is merely acting as a medium of information\nexchange.</span></p>\n\n<p style=\"text-align:justify;text-justify:inter-ideograph\"><b><span style=\"font-size:9.0pt;font-family:\" lang=\"EN-US\">Payment Terms</span></b><span style=\"font-size:\n9.0pt;font-family:\" lang=\"EN-US\"><br>\n(a) Payments</span><span style=\"font-size